import { useState, useEffect } from 'react';

export const GetAllMemberDevelopers = (props) => {
  const [developers, setAllDevelopers] = useState(null);

  // + adding the use
  useEffect(() => {
    const requestOptions = {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },

    };
    getData();

    // we will use async/await to fetch this data
    async function getData() {
      const response = await fetch("http://localhost:8000/getAllDevelopers", requestOptions);
      const apiResponseData = await response.json();
      //console.log(apiResponseData);//remove this after use
      setAllDevelopers(apiResponseData);
    }
  }, []);
  let style={
    marginLeft: "auto",
    marginRight: "auto",
    marginBottom: "20px",
    marginTop: "30px",
    width: "70%"
  }
  return (
    props.bucketNameDropdown === true ? <div>
      {developers && (
        <div className="col-md-4">
          <select id="inputAssignTo" className="form-select">
            {developers.map((developer, index) => (
              <option key={index}>{developer.developer_name}</option>
            ))}
          </select>
        </div>
      )}
    </div> : <div>
      {developers && (
        <div className="projects">

            {developers.map((developer, index) => (


              <div  style={style} className="card text-center">
                <div className="card-body">
                    <p className="card-text">
                    {developer.developer_name}
                    </p>

                </div>
            </div>

            ))}

        </div>
      )}
    </div>

  )
}
